import "../styles/colors.scss";
import "react-flexbox-grid/dist/react-flexbox-grid.css";
import { FirebaseProvider } from "api/firebase.js";

export default function MyApp({ Component, pageProps }) {
  return (
    <FirebaseProvider>
      <Component {...pageProps} />
    </FirebaseProvider>
  );
}
